class Solution {
    func minOperations(_ nums1: [Int], _ nums2: [Int]) -> Int {
        let n = nums1.count
        var max1 = nums1.max() ?? 0
        var max2 = nums2.max() ?? 0
        var operations = 0

        for i in 0..<n {
            if nums1[i] == max1 && nums2[i] == max2 {
                return operations
            }
            if nums1[i] == max1 || nums2[i] == max2 {
                continue
            }
            if nums1[i] < max1 && nums2[i] > max2 {
                max1 = max(max1, nums2[i])
                max2 = max(max2, nums1[i])
                operations += 1
            } else if nums2[i] < max2 && nums1[i] > max1 {
                max1 = max(max1, nums2[i])
                max2 = max(max2, nums1[i])
                operations += 1
            }
        }

        if nums1[n-1] == max1 && nums2[n-1] == max2 {
            return operations
        } else {
            return -1
        }
    }
}
